import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Pravesh from "./Pravesh";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      pravesh: "Pravesh"
    };
    console.log(props);
  }

  greet() {
    const x = 2;
    if (x === 1) {
      return <h1>Hello</h1>;
    } else {
      return <h1>Byeee</h1>;
    }
  }

  render() {
    this.setState({ pravesh: "Cool" });
    return this.greet();
  }
}

export default App;
